        __position: 2,
        __code: "<Alert\n  href=\"https://en.wikipedia.org/wiki/The_Legend_of_Drizzt\"\n  hrefText=\"The Legend of Drizzt\"\n>\n  <Text>\n    Station: In all the world of the drow, there is no more important word. It\n    is the calling of their\u2014of our\u2014 religion, the incessant pulling of\n    hungering heartstrings. Ambition overrides good sense and compassion is\n    thrown away in its face, all in the name of Lolth, the Spider Queen.\n    <br />\n    <br />\n    Ascension to power in drow society is a simple process of assassination.\n    The Spider Queen is a deity of chaos, and she and her high priestesses,\n    the true rulers of the drow world, do not look with ill favor upon\n    ambitious individuals wielding poisoned daggers.\n    <br />\n    <br />\n    Of course, there are rules of behavior; every society must boast of these.\n    To openly commit murder or wage war invites the pretense of justice, and\n    penalties exacted in the name of drow justice are merciless. To stick a\n    dagger in the back of a rival during the chaos of a larger battle or in\n    the quiet shadows of an alley, however, is quite acceptable\u2014even\n    applauded. Investigation is not the forte of drow justice. No one cares\n    enough to bother.\n    <br />\n    <br />\n    Station is the way of Lolth, the ambition she bestows to further the\n    chaos, to keep her drow \u201Cchildren\u201D along their appointed course of\n    self-imprisonment. Children? Pawns, more likely, dancing dolls for the\n    Spider Queen, puppets on the imperceptible but impervious strands of her\n    web. All climb the Spider Queen\u2019s ladders; all hunt for her pleasure; and\n    all fall to the hunters of her pleasure.\n    <br />\n    <br />\n    Station is the paradox of the world of my people, the limitation of our\n    power within the hunger for power. It is gained through treachery and\n    invites treachery against those who gain it. Those most powerful in\n    Menzoberranzan spend their days watching over their shoulders, defending\n    against the daggers that would find their backs. Their deaths usually come\n    from the front.\n  </Text>\n  <br />\n  <Text bold italic>\n    {' '}\n    Excerpt from \"Homeland\", by R.A. Salvatore{' '}\n  </Text>\n</Alert>",
